import 'bootstrap/dist/css/bootstrap.min.css';
import './Lap1.css';

function Lap1() {
    return (
        <div className="Lap1">
            <body class="bg-light">
                <div class="container p-5">
                    <div class="row">
                        <div class="col-lg-4 bg-dark text-white text-center py-4">
                            <div class="header-left">
                                <img src="https://scontent.fdad3-5.fna.fbcdn.net/v/t39.30808-6/400343623_1061458928205212_6318525344048745393_n.jpg?_nc_cat=106&ccb=1-7&_nc_sid=5f2048&_nc_ohc=QoqQzTLOOzsAX_exDm8&_nc_ht=scontent.fdad3-5.fna&oh=00_AfDvCTl2XxzfbvHrphgijg3cnaamexkcQcx-uCh5-Yl-BQ&oe=65EDDE88" class="img-thumbnail rounded-circle mb-2" />
                            </div>
                        </div>
                        <div class="col-lg-8 bg-light text-dark py-4 px-5">

                        </div>


                    </div>
                </div>

            </body>
        </div >
    );
}

export default Lap1;
